webpackJsonp([81381972371557],{278:function(e,a){e.exports={data:{markdownRemark:{html:"<p>In ordine alfabetico</p>\n<ul>\n<li>\n<p><strong>Andraste</strong><br>\nIl mio nome è Andraste. Porto alla Grande Madre delle Dolomiti la mia voce, che nei concerti nelle terre dell'Adige canta attorno al fuoco storie e fiabe connettendoli al ciclo universale e alle lune della Madre. Porto le mie Danze pagane, che porteranno ai popoli della provincia di Rovigo quest'anno la possibilità di connettersi alla Dea, alla Madre Verde che vive nelle nostre terre di fiume, alla voce del divino che vive nei loro corpi in movimento. Porto alla Grande Madre delle Dolomiti la speranza che questa mia dedicazione, questi miei talenti, possano portare frutto alle genti delle Dolomiti, dell'Adige e delle terre dove vivo perché io possa essere canale di interscambio tra questa terra che cammino e camminerò e tutte le terre che, nel mio andare con la voce e con il corpo, toccherò. Portando la Voce della Madre.</p>\n</li>\n<li>\n<p><strong>Daniela Albero</strong><br>\nIo sono Daniela Albero e porto la mia ricerca del Sacro Femminino fra Morico e Rezia, attraverso la storia, la leggenda, i simbolismi, ma anche attraverso l'ascolto della percezione dell'energia emanata dal territorio.</p>\n</li>\n<li>\n<p><strong>Dee Oltre le Nebbie</strong><br>\nAlla Fiamma portiamo il lavoro di connessione tra la terra Veneta e Avalon, il nostro lavoro di riscoperta della Dea nella Terra e la gioia del suo Sacro Servizio come sue Sacerdotesse, anche attraverso le celebrazioni in queste terre.</p>\n</li>\n<li>\n<p><strong>Franca Pippi Laberta</strong><br>\nSalve o Madre, Regina dei Monti Pallidi e salve alla schera di Spiriti con cui muovi da secoli e secoli i tuoi passi... su queste ed altre Terre. Ave! Qui m'inchino a te con tutte le Signore che da sempre nutrono ed insegnano il tuo cammino... Eccomi a te, con ciò che sono, Franca Pippi Laberta al secolo architetta, designer, scenografa - artista - artigiana e viaggiatrice del Mondo.</p>\n</li>\n<li>\n<p><strong>Francesca</strong><br>\nPorto alla Grande Fiamma delle Dolomiti me stessa, le mie ricerche, il mio profondo amore e radicamento verso questa terra e il mio impegno come Sua custode e guardiana.</p>\n</li>\n<li>\n<p><strong>Francesca Zeni</strong><br>\nSono Francesca e porto alla Fiamma il mio lavoro di naturopata, i percorsi di conoscenza sulla sacralità del proprio essere femminile portati avanti con donne di ogni età, dalle adolescenti alle donne più anziane, i percorsi di conoscenza sulla gravidanza, il parto e il dopo parto, che rappresentano moment importanti per conoscere il proprio reale potere; porto alla Fiamma la sorellanza e i momenti di incontro con altre Donne consapevoli; porto alla Fiamma il quotidiano saluto alla Dea, che rappresenta un riferimento presente ed antico, che apre il cuore alla dimensione più profonda dell'Amore e della comunicazione con ogni elemento del pianeta ma al contempo emana e trasmette grande Forza e determinazione.</p>\n</li>\n<li>\n<p><strong>Francesco \"Mondo\" Mondini - T'ai Chi Chin Italia</strong><br>\n\"Sono Francesco Mondini  e sono qui oggi in rappresentanza del Gruppo Insegnanti Accreditati di T'ai Chi Chin e di East Meet West Qigong italiani (siamo un piccolo gruppo), e in quanto amante della Natura e dell'attività fisica e sportiva libera e sana e della Grande Madre Terra.</p>\n</li>\n<li>\n<p><strong>Giordana Boscato - Tenda Rossa Merano</strong><br>\nPorto alla Fiamma il lavoro di recupero della sacralità del sangue delle donne. Porto alla Fiamma la volontà di ri-costruire Tende Rosse in cui le donne possano celebrare la femminilità e la loro ciclicità. Dono alla Fiamma il mio lavoro di ostetrica.</p>\n</li>\n<li>\n<p><strong>Laura Berti</strong><br>\nIo sono Laura Berti e porto alla Fiamma il mio amore per tutto ciò che è natura e il mio essere al servizio attraverso la canalizzazione dell'energia Reiki e il lavoro con il creatore attraverso il Theta Healing.</p>\n</li>\n<li>\n<p><strong>Laura Ghianda</strong><br>\nPorto alla Fiamma la devozione per Madre Montagna e per la Grande Madre che mi chiamò, la ri-membranza di Ella attraverso i cerchi che propongo, le ricerche, la creatività che vorrà donarmi.</p>\n</li>\n<li>\n<p><strong>Laura Violet Rimola</strong><br>\nSono Laura Violet e porto alla Fiamma la mia ricerca sul Sacro Femminino e il mio lavoro di recupero delle antiche Dee Madri delle Dolomiti e di tutto l'arco alpino. Porto alla Fiamma il mio impegno a far riemergere le vie sacre femminili e il mio amore sincero per la Grande Madre e per Avalon.</p>\n</li>\n<li>\n<p><strong>Paolo Veneziani - Il Cerchio di Anu OBOD Grove</strong><br>\nIo sono Bran Paolo Veneziani, Druido, Speaker, e Workshopleader dell'OBOD (Ordine dei Bardi Ovati e Druidi). Porto alla Fiamma innanzitutto il mio intento di riportare e far riconoscere la sacralità che ci circonda attraverso i meeting, i workshop e i seminari che propongo. Io e il mio Grove nutriremo questa Sacra Fiamma con la consapevolezza dell'importanza di alimentare in ogni essere il rispetto per se stessi, per la nostra Terra e la riscoperta delle antiche vie sul nostro territorio e nei nostri cuori, ponendo particolare attenzione alla ricerca degli aspetti legati alla riscoperta dei doni della Grande Madre. Sia così.</p>\n</li>\n<li>\n<p><strong>Sara Shar</strong><br>\nIntendo portare alla Fiamma il mio impegno personale di coerenza con gli ideali di unione e sorellanza/fratellanza su cui si basa la scoperta della Grande Madre che ho sperimentato in quest'ultimo anno, come simbolo del mio amore per questa Terra.</p>\n</li>\n<li>\n<p><strong>Silvia Fassan</strong><br>\nSono Silvia Fassan e nutro questa Fiamma con la mia danza come strumento di consapevolezza dell'essenza della Dea in ogni donna che con il suo corpo può rendere omaggio e celebrare il divino femminile che è in Lei.</p>\n</li>\n<li>\n<p><strong>Tempio della Grande Madre a.p.s.</strong><br>\nPortiamo il nostro lavoro di Servizio secondo i principi del nostro statuto, per una società ove la Grande Madre sia nuovamente ri-membrata e la sua sacralità restituita ad ogni singola/singolo.</p>\n</li>\n<li>\n<p><strong>Tenda Rossa Trento</strong><br>\nPortiamo alla Fiamma il nostro essere donne. Donne in ricerca sui temi della mestrualità, della sorellanza, del femminile e della sua sacralità. Nella vita di ogni giorno così come in seminari, workshop o incontri che proponiamo.</p>\n</li>\n</ul>",frontmatter:{path:"/realtà-acceso-fiamma",title:"Realtà che hanno acceso la Fiamma"}}},pathContext:{}}}});
